(4400, '', 'Se rencontrer et être amis, rien de plus facile ; demeurer ensemble et vivre en paix, voilà qui est difficile.', 1489, 1490, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4401, '', 'Servez Saint-Cosme et Saint-Denis, vous vous porterez toujours bien.', 1487, 1488, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4402, '', 'Servir les vieillards est un devoir, servir ses égaux est une politesse, servir les jeunes est une humiliation.', 1485, 1486, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4403, '', 'Servir un prince, c''est comme dormir avec un tigre.', 1483, 1484, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4404, '', 'S''escrimer des armes de Sanson.', 1481, 1482, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4405, '', 'Se tromper est d''un homme ; persévérer dans l''erreur est le fait du démon.', 1479, 1480, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4406, '', 'Seul celui qui a emprunté la route connaît la profondeur des trous.', 1477, 1478, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4407, '', 'Seule la mort n''a pas de remède.', 1475, 1476, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4408, '', 'Seul le muet peut faire taire un bavard.', 1473, 1474, '', 1, '2016-04-22 10:07:52', '2016-04-22 10:07:52', '', 0, '', 0, '', '0.00000000000000', 4398, 4),
(4409, 'http://www.linternaute.com/proverbe/recherche/s/8/', 'Les proverbes de l''internaute - s_8', 1448, 1469, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 3, 3),
(4410, '', 'Seuls vos vrais amis vous feront savoir que vous avez le visage sale.', 1449, 1450, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4411, '', 'Se venger d''une offense, c''est se mettre au niveau de son ennemi ; la lui pardonner, c''est se mettre au-dessus de lui.', 1467, 1468, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4412, '', 'Si, à la Chandeleur, le soleil fait lanterne, quarante jours après il hiverne.', 1465, 1466, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4413, '', 'Si ce n''est pour agir bien, abstiens-toi.', 1463, 1464, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4414, '', 'Si cent hommes nomment sage un fou, il le devient.', 1461, 1462, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4415, '', 'Si, contre la vague, la mer frise, Saute de vent vient en surprise.', 1459, 1460, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4416, '', 'Si dans ta case, il y a bonheur, sache que le malheur a seulement ajourné sa visite.', 1457, 1458, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4417, '', 'Si de beaucoup travailler on devenait riche, les ânes auraient le bât doré.', 1455, 1456, '', 1, '2016-04-22 10:07:53', '2016-04-22 10:07:53', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4418, '', 'Si décembre est sous la neige, La récolte elle protège.', 1453, 1454, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4419, '', 'Si derrière toute barbe il y avait de la sagesse, les chèvres seraient toutes prophètes.', 1451, 1452, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4409, 4),
(4420, 'http://www.linternaute.com/proverbe/recherche/s/9/', 'Les proverbes de l''internaute - s_9', 1426, 1447, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 3, 3),
