(4423, '', 'Si deux pierres se querellent, c''est pas à l''œuf de les séparer.', 1443, 1444, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4424, '', 'Si Dieu ne pardonnait pas, son paradis resterait vide.', 1441, 1442, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4425, '', 'Si en te baignant tu as échappé au crocodile, prends garde au léopard sur la berge.', 1439, 1440, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4426, '', 'Si février n''a ni pluies, ni giboulées, Tous les mois de l''année seront ennuyés.', 1437, 1438, '', 1, '2016-04-22 10:07:54', '2016-04-22 10:07:54', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4427, '', 'Si février n''a pas de grands froids,  Le vent dominera tout le reste du mois.', 1435, 1436, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4428, '', 'Si grand, si resplendissant que soit le soleil, le plus petit nuage qui passe le dérobe à nos yeux.', 1433, 1434, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
(4429, '', 'Si haut que parvienne une chose lancée, c''est à terre qu''elle retourne.', 1431, 1432, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4420, 4);
