(4430, '', 'Si Jésus-Christ me vient en aide, je me moque des anges!', 1429, 1430, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4420, 4),
