(4432, '', 'Si juin fait la quantité, Septembre fait la qualité.', 1405, 1406, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
(4433, '', 'Si la barbe était signe d''intelligence, la chèvre serait Socrate!', 1423, 1424, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
