(4435, '', 'Si la branche vieillit, tu ne pourras plus la courber.', 1419, 1420, '', 1, '2016-04-22 10:07:55', '2016-04-22 10:07:55', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
(4436, '', 'Si la chance est avec toi, pourquoi te hâter ? Si la chance n''est pas avec toi, pourquoi te hâter ?', 1417, 1418, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
(4437, '', 'Si la chance veut venir à toi, tu la conduiras avec un cheveu ; mais si la chance veut partir, elle rompra une chaîne.', 1415, 1416, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
(4438, '', 'Si la fortune ne vient pas à votre rencontre, ce n''est pas au galop d''un cheval que vous l''attraperez.', 1413, 1414, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
