(4440, '', 'Si l''animal est reconnaissant, comment l''homme ne le serait-il pas ?', 1409, 1410, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
(4441, '', 'Si la parole est d''or, le silence est de perle.', 1407, 1408, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4431, 4),
