(4444, '', 'Si la personne est âgée, son coeur ne l''est pas.', 1401, 1402, '', 1, '2016-04-22 10:07:56', '2016-04-22 10:07:56', '', 0, '', 0, '', '0.00000000000000', 4442, 4),
