(4446, '', 'Si l''arc-en-ciel paraît, trois jours beaux, trois jours laids.', 1397, 1398, '', 1, '2016-04-22 10:07:57', '2016-04-22 10:07:57', '', 0, '', 0, '', '0.00000000000000', 4442, 4),
