(4454, '', 'Si le chameau pouvait voir sa bosse, il tomberait de honte.', 1361, 1362, '', 1, '2016-04-22 10:07:57', '2016-04-22 10:07:57', '', 0, '', 0, '', '0.00000000000000', 4453, 4),
