(4463, '', 'Si le Dauphiné était un mouton, Tullins en serait le rognon.', 1363, 1364, '', 1, '2016-04-22 10:07:58', '2016-04-22 10:07:58', '', 0, '', 0, '', '0.00000000000000', 4453, 4),
