(4473, '', 'Silence bien gardé, vaut mieux que parole mal lâchée.', 1343, 1344, '', 1, '2016-04-22 10:07:59', '2016-04-22 10:07:59', '', 0, '', 0, '', '0.00000000000000', 4464, 4),
