(4476, '', 'Si le péché est cocher, la honte sera valet de pied.', 1317, 1318, '', 1, '2016-04-22 10:08:00', '2016-04-22 10:08:00', '', 0, '', 0, '', '0.00000000000000', 4475, 4),
