(5109, '', 'Vilaine féconde vaut mieux que belle stérile.', 51, 52, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5110, '', 'Vilain enrichi ne connaît ni parent ni ami.', 69, 70, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5111, '', 'Ville qui parlemente est à demi rendue.', 67, 68, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5112, '', 'Vin de mai, Piquette de chais.', 65, 66, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5113, '', 'Vin sans ami, vie sans témoins.', 63, 64, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5114, '', 'Vite et bien ne vont jamais ensemble.', 61, 62, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5115, '', 'Voir trente-six chandelles.', 59, 60, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5116, '', 'Votre ami avale vos fautes, votre ennemi vous le ressert.', 57, 58, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5117, '', 'Votre fils sera tel que vous l''aurez élevé ; et votre mari, tel que vous l''aurez habitué.', 55, 56, '', 1, '2016-04-22 10:09:07', '2016-04-22 10:09:07', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5118, '', 'Voulez-vous qu''on croie du bien de vous ? N''en dites pas.', 53, 54, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5108, 4),
(5119, 'http://www.linternaute.com/proverbe/recherche/v/5/', 'Les proverbes de l''internaute - v_5', 28, 49, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 3, 3),
(5120, '', 'Vouloir, c''est pouvoir.', 29, 30, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5121, '', 'Vouloir donner de l''éducation à un homme indigne, c''est prétendre placer des noix sur une coupole.', 47, 48, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5122, '', 'Vous avez beau cacher la queue d''un âne, il montrera toujours ses oreilles.', 45, 46, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5123, '', 'Vous ne pouvez pas empêcher les oiseaux de la tristesse de voler au-dessus de vos têtes, mais vous pouvez les empêcher de faire leurs nids dans vos cheveux.', 43, 44, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5124, '', 'Vous ne pouvez pas faire sur mesure les situations de la vie, mais vous pouvez faire sur mesure les attitudes pour s''adapter à ces situations.', 41, 42, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5125, '', 'Vous ne pouvez pas juger un arbre d''après son écorce.', 39, 40, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5126, '', 'Vous ne pouvez pas vendre la vache et boire son lait.', 37, 38, '', 1, '2016-04-22 10:09:08', '2016-04-22 10:09:08', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5127, '', 'Vous ne saurez jamais ce dont vous êtes capable si vous n''essayer pas.', 35, 36, '', 1, '2016-04-22 10:09:09', '2016-04-22 10:09:09', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5128, '', 'Vous ne saurez jamais ce dont vous êtes capable si vous n''essayez pas.', 33, 34, '', 1, '2016-04-22 10:09:09', '2016-04-22 10:09:09', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5129, '', 'Voyage des maîtres, noces de valets.', 31, 32, '', 1, '2016-04-22 10:09:09', '2016-04-22 10:09:09', '', 0, '', 0, '', '0.00000000000000', 5119, 4),
(5130, 'http://www.linternaute.com/proverbe/recherche/y/1/', 'Les proverbes de l''internaute - y_1', 24, 27, '', 1, '2016-04-22 10:09:09', '2016-04-22 10:09:09', '', 0, '', 0, '', '0.00000000000000', 3, 3),
(5131, '', 'Y penser sans cesse ne labourera pas le champ.', 25, 26, '', 1, '2016-04-22 10:09:09', '2016-04-22 10:09:09', '', 0, '', 0, '', '0.00000000000000', 5130, 4);
